import styled from "styled-components";

export const Container = styled.div`
    width:12rem;
    height: 14rem;
    display: flex;
    flex-direction: column;
    align-items:center;
    border-radius:10px;


    img {
        width: 12rem;
        height:11rem;
        border-radius:10px;
    }
`;
